  return (
    <div>
        <section class="content">
            <div id="left" style={{ backgroundImage:`url(${image})`, backgroundRepeat:"no-repeat", backgroundSize:"contain", height:700,width:200 }} >djp</div>
            <div id="center">content</div>
            <div id="right">right</div>
        </section>

    </div>
  )
}

export default Headauto
